import React from 'react'


const Personajes = ({personaje = []}) =>{

    return(

    <div className='row'>
                  { personaje.map(pers => { 
                      return <div class="col">
                               <div className='card'>
                                <img src={pers.image} alt="" />
                                <div className='card-body'>
                                    <h5 >{pers.name}</h5>    
                                </div>   
                                </div>
                     </div>
                  })
                  }
    </div>
)
}

export default Personajes
